https://logo-detection.logo-detection.wikimedia.org:
- path: /v1/models/logo-detection:predict
  json_body:
    instances:
      - filename: "Cambia_logo.png"
        # Notes:
        # 1. image source: https://commons.wikimedia.org/wiki/File:Cambia_logo.png
        # 2. create encoded string: `$ base64 -w0 < Cambia_logo.png`
        image: ""
        target: "logo"
    debug: true
  assert_status: 200
  assert_body_contains: prediction
  method: POST
